panels.queryString:
$$logsrc  Jenkins_Log
| json "threadId", "logType", "logLevel", "logMessage", "logSource", "eventTime", "logStackTrace" as %"Thread ID", %"Log Type", %"Log Level", %"Log Message", %"Log Source", %"Event Time", %"Log Stack Trace" nodrop
| where %"Log Level" matches {{LogLevel}} AND %"Log Message" matches {{LogMessage}}
| where %"Log Message" matches "*WARN*" OR %"Log Message" matches "*Warn*" OR %"Log Message" matches "*warn*" OR %"Log Message" matches "*FAIL*" OR %"Log Message" matches "*Fail*" OR %"Log Message" matches "*fail*" OR %"Log Message" matches "*EXCEPTION*" OR %"Log Message" matches "*Exception*" OR %"Log Message" matches "*exception*" OR %"Log Message" matches "*ERROR*" OR %"Log Message" matches "*Error*" OR %"Log Message" matches "*error*"
| timeslice {{TimeSlice}}
| count as Errors by _timeslice
| compare with timeshift {{TimeCompare}}
| fillmissing timeslice({{TimeSlice}})

$$logsrc  {{LogLevel}}
| where _sourceName matches "{{JobName}}#{{BuildNumber}}"
| parse field=_raw "[*] *" as Time, %"Log Message"
| trim (%"Log Message")
| where %"Log Message" matches {{LogMessage}}
| where %"Log Message" matches "*WARN*" OR %"Log Message" matches "*Warn*" OR %"Log Message" matches "*warn*" OR %"Log Message" matches "*FAIL*" OR %"Log Message" matches "*Fail*" OR %"Log Message" matches "*fail*" OR %"Log Message" matches "*EXCEPTION*" OR %"Log Message" matches "*Exception*" OR %"Log Message" matches "*exception*" OR %"Log Message" matches "*ERROR*" OR %"Log Message" matches "*Error*" OR %"Log Message" matches "*error*"
| timeslice {{TimeSlice}}
| count as Errors by _timeslice
| compare with timeshift {{TimeCompare}}
| fillmissing timeslice({{TimeSlice}})

$$logsrc  Job_Status
| json "name", "result", "number" as JobName, Result, BuildNumber
| where JobName matches {{JobName}} and BuildNumber matches {{BuildNumber}}
| if(Result matches "SUCCESS", 1, 0) as Success
| if(Result matches "SUCCESS", 0, 1) as Failure
| timeslice {{TimeSlice}}
| count as Total, sum(Success) as Success, sum(Failure) as Failure by _timeslice 
| compare with timeshift {{TimeCompare}}
| fillmissing timeslice({{TimeSlice}})
| fields - Success, Failure, Success_1d, Failure_1d

$$logsrc  Job_Status
| json "name", "result", "jobRunDuration", "number" as JobName, Result, Duration, BuildNumber
| where JobName matches {{JobName}} and BuildNumber matches {{BuildNumber}}
| timeslice {{TimeSlice}}
| Duration/60 as Duration
| avg(Duration) as Average, max(Duration) as Maximum, min(Duration) as Minimum by _timeslice 
| compare with timeshift {{TimeCompare}}
| fillmissing timeslice({{TimeSlice}})
| fields - Maximum, Minimum, Maximum_1d, Minimum_1d

$$logsrc  Queue_Event
| json "queueId", "queueTime", "isBlocked", "reasonForBlock", "isConcurrentBuild", "jobName", "jobURL" as %"Queue Id", %"Queue Time(sec)", Blocked, Reason, %"Concurrent Build", Name, URL nodrop
| where URL matches {{JobName}}
| timeslice {{TimeSlice}}
| First(%"Queue Time(sec)") as %"Queue Time(sec)" by %"Queue Id", _timeslice
| %"Queue Time(sec)"/60 as QueueTime
| avg(QueueTime) as Average, max(QueueTime) as Maximum, min(QueueTime) as Minimum by _timeslice
| compare with timeshift {{TimeCompare}}
| fillmissing timeslice({{TimeSlice}})
| fields - Maximum, Minimum, Maximum_1d, Minimum_1d

$$logsrc  Job_Status {{Name}}
| _sourceHost as Master
| json "name", "result" as Name, Result
| where Name = {{Name}}
| where Result matches "SUCCESS"
| count as Success by Name

$$logsrc  Job_Status {{Name}}
| _sourceHost as Master
| json "name", "result", "jobRunDuration" as Name, Result, Duration
| where Name = {{Name}}
| Duration/60 as Duration
| max(Duration) by Name

$$logsrc  Job_Status {{Name}}
| _sourceHost as Master
| json "name", "result" as Name, Result
| where Name = {{Name}}
| count as Total_Build by Name

$$logsrc  Job_Status {{Name}}
| _sourceHost as Master
| json "name", "result" as Name, Result
| where Name = {{Name}}
| where !(Result matches "SUCCESS")
| count as Failed by Name

search.queryText:
$$logsrc  Job_Status {{Job_Name}}
| json "name", "number"
| where name = {{Job_Name}}
| json "testResult.failures", "testResult.passes", "testResult.skips" as Failed, Passed, Skipped
| avg(Failed) as Failed, avg(Passed) as Passed, avg(Skipped) as Skipped by number

$$logsrc  Test_Result {{Job_Name}}
| json "name"
| where name = {{Job_Name}}
| json "testResult" as statusValues
| parse regex field=statusValues "(?<TestResult>\{[^\}]+\})" multi
| json auto field=TestResult
| className as Class_Name | testName as Test_Name| duration as Test_Duration | status as Test_Status | errorStackTrace as Error_Stack_Trace | errorDetails as Error
| where Test_Name matches {{Test_Name}}
| count by Class_Name, Test_Name, Test_Status, Test_Duration, Error, errorStackTrace
